$	c (\bar \epsilon^p) = \left\{ 
	\begin{array}{ll} 
	c_i + \dfrac{(c_p-c_i)}{\bar \epsilon^p_I}\bar \epsilon^p & \text{para zona I} \\ 
	c_p, & \text{para zona II} \\
	c_p + \dfrac{(c_r-c_p)}{\bar \epsilon^p_r-\bar \epsilon^p_{II}}(\bar \epsilon^p - \bar \epsilon^p_{II}), & \text{para zona III} \\	
	c_r, & \text{para zona IV}
	\end{array}\right.
$
